import React from 'react'
import S from '../input/style'
import Text from '../../components/text/size';

const ProfileCard = () => {
  return (
    <S.ProfileCardWrapper>
        <S.ProfileImage>
            <img src="/assets/img/profile.png" alt=""/>
        </S.ProfileImage>
        <S.ProfileInfo>
            <Text.Title3>이름</Text.Title3>
        </S.ProfileInfo>

    </S.ProfileCardWrapper>
  )
}

export default ProfileCard
